import React from 'react'

const RouteLink = ({text, onClickFunction, newRoute}) => {
    return (
        <div className='rl-outer'>
            <p
                className='rl-inner'
                onClick={ () => onClickFunction(newRoute)}
            >{text}</p>
        </div>
    )
}

export default RouteLink;
